import "./App.css";
import QuoteContainer from "./quoteContainer/QuoteContainer";
import axios from "axios";
import { useState, useEffect } from "react";

function App() {
  const [data, setData] = useState([]);

  if (data == []) {
    useEffect(() => {
      axios.get("http://localhost:8000/allphrases").then((response) => {
        let myObj = JSON.parse(response.data);
        setData(myObj.data);
      });
    });
  }

  return (
    <div className="App">
      <QuoteContainer data={data} />
    </div>
  );
}

export default App;
